import React, { Component } from "react";
import { Grid, Image, Container, Icon } from "semantic-ui-react";
import Form from "./Form";
import "./style.css";
import PageTitle from "../../PageTitle/PageTitle";
import skills from "./images/skills_white.png";
import AOS from "aos";
import "aos/dist/aos.css";

export default class Contact extends Component {
  componentDidMount() {
    AOS.init();
  }
  render() {
    return (
      <div>
        <Container id="contact">
          <div className="wrapper">
            <PageTitle title="My" secondImage={skills} />
            <div
              class="skills_grid"
              data-aos="fade-down"
              data-aos-duration="1000"
              data-aos-delay="200"
            >
              <Grid columns="five" divided>
                <Grid.Row>
                  <Grid.Column>

                  </Grid.Column>
                </Grid.Row>
              </Grid>
            </div>
          </div>
        </Container>
      </div>
    );
  }
}
